    protected async Task getTaskDetails(int JobId_fromMasterAPI)
    {

        if (JobId != JobId_fromMasterAPI)
        {
            Imagename = "Images/expand.png";
            showDetails = true;

        }
        else
        {
            if (showDetails == false)
